import React from "react";
import { NavLink } from "react-router-dom";
import axios from "axios";

function clickHandler(){
	const url = "https://swapi.co/api/people/?page=";
	const page = [1, 2, 3, 4, 5, 6, 7, 8, 9];
	const link = url+page;
	const res = axios.get(link)
		this.setState({ people: res.data.results });
}

const Navigation = () => {
	return (
		<div className="tab">
			<button>
				<NavLink to="/" onClick={clickHandler}>Home</NavLink>
			</button>
			<button>
				<NavLink to="/previous">Previous Page</NavLink>
			</button>
			<button>
				<NavLink to="/next">Next Page</NavLink>
			</button>
		</div>
	);
};

export default Navigation;
